tcg OBJECT IDENTIFIER ::= { 2 23 133 } tcg-dice OBJECT IDENTIFIER ::= { tcg platformClass(5) 4 } TCB Info TCB Info represents the data and metadata associated with the component identity. It can be roughly split into two logically separate parts: naming / identification attributes on one side (i.e., vendor, vendorInfo, model, version, svn, layer and index), measurement values on the other (i.e., fwids, flags and type) See Section 6.1.1 of the Attestation Architecture document for a detailed description of the semantics associated with individual fields. tcg-dice-TcbInfo OBJECT IDENTIFIER ::= {tcg-dice 1} DiceTcbInfo ::== SEQUENCE { vendor [0] IMPLICIT UTF8String OPTIONAL, model [1] IMPLICIT UTF8String OPTIONAL, version [2] IMPLICIT UTF8String OPTIONAL, svn [3] IMPLICIT INTEGER OPTIONAL, layer [4] IMPLICIT INTEGER OPTIONAL, index [5] IMPLICIT INTEGER OPTIONAL, fwids [6] IMPLICIT FWIDLIST OPTIONAL, flags [7] IMPLICIT OperationalFlags OPTIONAL, vendorInfo [8] IMPLICIT OCTET STRING OPTIONAL, type [9] IMPLICIT OCTET STRING OPTIONAL
} FWIDLIST ::== SEQUENCE SIZE (1..MAX) OF FWID FWID ::== SEQUENCE { hashAlg OBJECT IDENTIFIER, digest OCTET STRING
} OperationalFlags ::= BIT STRING { notConfigured (0), notSecure (1), recovery (2), debug (3)
} Multiple TCB Info payloads, each associated with a different component in the layer, can be put together into the same certificate using a DiceTcbInfoSeq: tcg-dice-MultiTcbInfo OBJECT IDENTIFIER ::= { tcg-dice 5 } DiceTcbInfoSeq ::= SEQUENCE SIZE (1..MAX) OF DiceTcbInfo Even though further extensions have been defined (for the full list see Section 6.1 of "Attestation Architecture" -- for example one that allows unsigned EAT claims to be embedded in an X.509 extension -- DiceTcbInfo is the (currently) preferred way.

