You can update the attestation result by defining one or more of the following rules: status hw_authenticity sw_integrity sw_up_to_dateness config_integrity runtime_integrity certification_status The first overwrites the overall attestation result status. The subsequent rules overwrite the corresponding entries in the trust vector. The rules must be defined such that they produce the string "SUCCESS" if the conditions have been met, and the string "FAILURE" otherwise. As various versions are often represented using Semantic Versioning, policy package provides a utility function, semver_cmp to aid in their comparison (note: currently, pre-release suffixes are not supported). For example: sw_integrity = "SUCCESS" { # note: This is an example. The evidence entries do not correspond to any # actual scheme. evidence["application-hash"] == "h0KPxSKAPTEGXnvOPPA/5HUJZjHl4Hu9eg/eYMTPJcc=" evidence["firmware-hash"] == "h0KPxSKAPTEGXnvOPPA/5HUJZjHl4Hu9eg/eYMTPJcc=" semver_cmp(evidence["firmware-version"], "1.2.0") >= 0
} else = "FAILURE" Dealing With Multiple Attestation Schemes If you expect your policy to be applied to inputs from multiple attestation schemes, you differentiate between them using the format variable defined by the policy package. For example you can define rules for each scheme, and then alias the generic rules above to one of them based on the value of the format variable. For example: sw_up_to_dateness = psa_sw_up_to_dateness { format == "PSA_IOT" } else = enacttrust_sw_up_to_dateness { format == "TPM_ENACTTRUST" } psa_sw_up_to_dateness = "SUCCESS" { # ...
} else = "FAILURE" enacttrust_sw_up_to_dateness = "SUCCESS" { # ...
} else = "FAILURE"

