The following example illustrates how to implement a map extension by extending comid.Entity with the following features: an optional "email" field additional constraint on the existing "name" field that it contains a valid UUID (note: since NameEntry is a type choice extensible, this can also be done by defining a new value type for NameEntry -- see the following section). package main import ( "encoding/json" "fmt" "log" "github.com/google/uuid" "github.com/veraison/corim/comid" "github.com/veraison/corim/extensions"
) // the struct containing the extensions
type EntityExtensions struct { // a string field extension Email string `cbor:"-1,keyasint,omitempty" json:"email,omitempty"`
} // custom constraints for Entity
func (o EntityExtensions) ConstrainEntity(val *comid.Entity) error { _, err := uuid.Parse(val.EntityName.String()) if err != nil { return fmt.Errorf("invalid UUID: %w", err) } return nil
} var sampleText = `
{ "name": "31fb5abf-023e-4992-aa4e-95f9c1503bfa", "regid": "https://acme.example", "email": "info@acme.com", "roles": [ "tagCreator", "creator", "maintainer" ]
}
` func main() { var entity comid.Entity extMap := extensions.NewMap().Add(comid.ExtEntity, &EntityExtensions{}) entity.RegisterExtensions(extMap) if err := json.Unmarshal([]byte(sampleText), &entity); err != nil { log.Fatalf("ERROR: %s", err.Error()) } if err := entity.Valid(); err != nil { log.Fatalf("failed to validate: %s", err.Error()) } else { fmt.Println("validation succeeded") } // obtain the extension field value via a generic getter email := entity.Extensions.MustGetString("email") fmt.Printf("entity email: %s\n", email) // retrive the extensions struct and get value via its field. exts := entity.GetExtensions().(*EntityExtensions) fmt.Printf("also entity email: %s\n", exts.Email)
}

