note Proper installation and setup of Keycloak is outside the scope of this README. Please refer to the Keycloak documentation for complete installation instructions. The instructions below show how to get something running with minimal effort for local development and testing only. Keycloak requires OpenJDK 21. This is not part of Veraison dependencies and is not installed as part of bootstrap. If you don't already have it on your system, you will need to install it. # On Arch
sudo pacman -S jdk21-openjdk # On Ubuntu
sudo apt install openjdk-21-jdk You will then need to make sure that JAVA_HOME points to it: export JAVA_HOME=/usr/lib/jvm/java-21-openjdk Pick an install destination (must exist), and download and extract Keycloak into it: export INSTALL_DEST=${HOME}
wget -O- https://github.com/keycloak/keycloak/releases/download/25.0.2/keycloak-25.0.2.tar.gz | \ tar xzf - -C ${INSTALL_DEST}
export KEYCLOAK_ROOT=${INSTALL_DEST}/keycloak-25.0.2 Setup the new install to work with the deployment: ./deployment.sh setup-keycloak ${KEYCLOAK_ROOT} localhost \ ${VERAISON_ROOT}/certs/rootCA.{crt,key} 11111 The first argument to the setup-keycloak command is the root directory of the keycloak installation. The second argument is a comma-separated list of names that will be used in the certificate (in the listing above it's just "localhost"). The third and fourth arguments are the root certificate and its key that will be used to sign Keycloak's cert. This must be the same root cert that was used for the Veraison deployment (the listing above assumes that you've generated the root with gen-root-cert command as described above, if not, then adjust the paths as appropriate). The final argument is the port Keycloak will be listening on. The setup command will also generate a new key for the server, and copy the example Veraison realm into its data path. Finally, re-build, and start the server: ${KEYCLOAK_ROOT}/bin/kc.sh build
${KEYCLOAK_ROOT}/bin/kc.sh start --import-realm The --import-realm option will cause the server to import the example veraison realm .
